import { mapValues } from './mapValues';
import { pipe } from './pipe';
describe('data first', function () {
    test('mapValues', function () {
        expect(mapValues({
            a: 1,
            b: 2,
        }, function (value, key) { return value + key; })).toEqual({
            a: '1a',
            b: '2b',
        });
    });
});
describe('data last', function () {
    test('mapValues', function () {
        expect(pipe({
            a: 1,
            b: 2,
        }, mapValues(function (value, key) { return value + key; }))).toEqual({
            a: '1a',
            b: '2b',
        });
    });
});
